import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
      <header>
        <h1>Sitemap Searcher</h1>
      </header>
      <footer>
        <small>&copy; { new Date().getFullYear() } Jim Chua</small>
      </footer>
    </>
  );
}

export default App;
